class Industry(object):
    """
    Stores relevant information for each industry.

    ...

    Attributes
    ----------
    index : int
        index variable/unique identifier.
    title : str
        Reader-friendly display text for the industry.
    generation : int
        where in the hierarchy the industry falls. High numbers = lower in this hierarchy
    parent : int
        code of industry above in the hierarchy
    children : list
        codes of industries directly below in the hierarchy
    siblings : list
        codes of industries that share a parent industry
    orphan : bool
        inidcates if industry is idnentical to parent (no siblings)

    Methods
    -------
    derive_generation:
        Computes the industry's generation
    """
    def __init__(self, code):
        """
        Constructs necessary attributes for the industry

        Parameters
        ----------
            code : int
                numeric unique identifer of the industry.
        """
        self.index = code
        self.title = industry_titles[code]
        self.generation = self.derive_generation(code)
        if code == 10:
            self.parent = None
        else:
            self.parent = parent_industry[code]
        if self.generation == 7:
            self.children = []
        else:
            self.children = child_industries[code]
        
        if code == 10:
            self.siblings = [10]
            self.orphan = True
        else:
            self.siblings = sibling_industries[code]
            self.orphan = len(self.siblings) == 1
                
    def derive_generation(self, code):
        """
        Computes the industry's generation

        Parameters
        ----------
            code : int
                numeric unique identifer of the industry.

        Returns
        -------
            generation : int
                industry generation identifier
        """
        if code == 10:
            return 0
        elif code <= 99:
            return 3
        elif code <= 102:
            return 1
        elif code <= 999:
            return 4
        elif code <= 1029:
            return 2
        elif code <= 9999:
            return 5
        elif code <= 99999:
            return 6
        elif code <= 999999:
            return 7 


